import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const ProfileView = () => {
  return (
    <div>
      <div>profile page</div>
      <div>
        <Button variant="primary" size="lg" active>
          Saved workouts
        </Button>
        <Button variant="secondary" size="lg" active>
          Add new workouts
        </Button>
      </div>
    </div>
  );
};

export default ProfileView;
